import React,{ useEffect } from "react";
// import { Link } from "react-router-dom";
import axios from 'axios';

function Blog() {
    useEffect(() => {
        document.title = 'from';
        
        async function getdata() {

            try {
                const res = await axios.get('https://starsunfolded.com/wp-json/wp/v2/posts')
                console.log(res);    
            } catch (error) {
                console.log('ok')
            }
            
        }
        getdata()
    });


    return (
        <>
            <br/>
            <br/>
            <br/>
            <br/>
            <h1>from</h1>
        </>
    )
}

export default Blog
